def force_num(val_init) :
	try:
		return_value = float(val_init)
	except ValueError:
		try:
			return_value = int(val_init)
		except ValueError:
			return_value = 0
	return return_value

def to_num(val_init) :
	try:
		return_value = int(val_init)
	except ValueError:
		try:
			return_value = float(val_init)
		except ValueError:
			return_value = val_init
	return return_value

